import React, { Component } from 'react';
import { Switch, Route } from 'react-router-dom';
import './App.css';
import Home from './components/home';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div>
          <Switch>
            <Route exact path='/' render={() => <Home />}></Route>
          </Switch>
        </div>
      </div>
    );
  }
}

export default App;
